DELIMITER $$
CREATE TRIGGER `tg_validate_document_number` BEFORE INSERT ON `contacts` FOR EACH ROW BEGIN
    DECLARE minChars INT(11);
    DECLARE maxChars INT(11);

    -- Fetch the corresponding TypeDocument record based on TypeDocumentID
    SELECT min_chars, max_chars INTO minChars, maxChars
    FROM document_types
    WHERE id = NEW.document_type_id;

    -- Check if the document number length is within the valid range
    IF CHAR_LENGTH(NEW.document_number) < minChars OR CHAR_LENGTH(NEW.document_number) > maxChars THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Longitud del número de documento no válida';
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tg_validate_document_number_update` BEFORE UPDATE ON `contacts` FOR EACH ROW BEGIN
    DECLARE minChars INT(11);
    DECLARE maxChars INT(11);

    SET @typeDocumentId = IFNULL(NEW.document_type_id, OLD.document_type_id);
    SET @oldNumberDocument = IFNULL(NEW.document_number, OLD.document_number);

    -- Fetch the corresponding TypeDocument record based on TypeDocumentID
    SELECT min_chars, max_chars INTO minChars, maxChars
    FROM document_types
    WHERE id = @typeDocumentId;

    -- Check if the document number length is within the valid range
    IF CHAR_LENGTH(@oldNumberDocument) < minChars OR CHAR_LENGTH(@oldNumberDocument) > maxChars THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Longitud del número de documento no válida';
    END IF;
END
$$
DELIMITER ;

