  `codigo` char(8) NOT NULL,
  `emailCorporativo` varchar(100) NOT NULL,
  `telefono` char(12) NOT NULL,
  `dni` char(8) NOT NULL,
  `seguro` bit(1) NOT NULL DEFAULT b'0',
  `estado` int(1) NOT NULL DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

--
-- Volcado de datos para la tabla `empleado`
--


--
-- Disparadores `empleado`
--
DELIMITER $$
CREATE TRIGGER `updateCodEmpleado` BEFORE INSERT ON `empleado` FOR EACH ROW begin 
	declare iPaterno char(1);
    declare iMaterno char(1);
    declare iNombre char(1);
    declare newCodigo char(8);
    select subString(aPaterno,1,1) into iPaterno from ciudadano where dni=new.dni;
    select subString(aMaterno,1,1) into iMaterno from ciudadano where dni=new.dni;
	select subString(nombre,1,1) into iNombre from ciudadano where dni=new.dni;
    select codEmpleado(concat('',iPaterno,iMaterno,iNombre)) into newCodigo;
    set new.codigo=newCodigo;
end
$$
DELIMITER ;

