--
-- Disparadores `document`
--
DELIMITER $$
CREATE TRIGGER `trg_update_state_table` AFTER INSERT ON `document` FOR EACH ROW BEGIN
	DECLARE _idTable INT;
    DECLARE _idOrder INT;
    set _idOrder = new.id_order;
    SELECT o.id_table into _idTable from orders o WHERE o.id_order=_idOrder;
    UPDATE tables SET state=1 WHERE id_table=_idTable;
    UPDATE orders SET state='PAGADA' WHERE id_order=_idOrder;
END
$$
DELIMITER ;

